  sessionId: z.string(),
  todos: z.string(),
  conversation: z.string().nullable(),
  hasConversation: z.boolean(),
  lastModified: z.string(),
  todoCount: z.number(),
  pendingCount: z.number(),
  completedCount: z.number()
})

// Configura√ß√£o
const CLAUDE_BASE = '/Users/agents/.claude'
