          <div className="text-center p-3 bg-green-50 rounded">
            <div className="text-2xl font-bold text-green-600">{stats.completed}</div>
            <div className="text-sm text-gray-600">Conclu√≠das</div>
          </div>
        </div>

        <div className="mb-4">
          <div className="flex justify-between text-sm text-gray-600 mb-1">
            <span>Progresso Geral</span>
            <span>{progressPercentage}%</span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-3">
            <div
              className="bg-green-500 h-3 rounded-full transition-all duration-300"
              style={{ width: `${progressPercentage}%` }}
            />
          </div>
        </div>

        <div className="text-xs text-gray-500 text-center">
          √öltima atualiza√ß√£o: {format(new Date(), 'dd/MM/yyyy HH:mm:ss', { locale: ptBR })}
        </div>
      </div>

      <div className="space-y-3">
        {todos.map((todo: Todo) => (
          <div
            key={todo.id}
            className={`bg-white rounded-lg shadow-sm border p-4 hover:shadow-md transition-all duration-200 ${
              todo.status === 'completed' ? 'opacity-75' : ''
            }`}
          >
            <div className="flex items-start justify-between">
              <div className="flex-1">
                <p className={`text-sm font-medium mb-2 ${
                  todo.status === 'completed' ? 'line-through text-gray-600' : 'text-gray-900'
                }`}>
                  {todo.content}
                </p>
                <div className="flex gap-2">
                  <span className={`text-xs px-2 py-1 rounded-full ${statusColors[todo.status]}`}>
                    {statusLabels[todo.status]}
                  </span>
                  <span className={`text-xs px-2 py-1 rounded-full border ${priorityColors[todo.priority]}`}>
                    Prioridade: {todo.priority === 'high' ? 'Alta' : todo.priority === 'medium' ? 'M√©dia' : 'Baixa'}
                  </span>
                </div>
              </div>
              <div className="text-xs text-gray-500">
                #{todo.id}
              </div>
            </div>
          </div>
        ))}
      </div>

      {todos.length === 0 && (
        <div className="text-center text-gray-500 mt-8">
          Nenhuma tarefa encontrada
        </div>
      )}
    </div>
  )
}

