// Capturar erros do console
const errors = [];
const originalError = console.error;
console.error = function(...args) {
  errors.push(args.join(' '));
  originalError.apply(console, args);
};

// Verificar se h√° conte√∫do na p√°gina
const bodyContent = document.body.innerHTML;
const hasContent = bodyContent && bodyContent.trim().length > 0;

// Retornar informa√ß√µes
JSON.stringify({
  errors: errors,
  hasContent: hasContent,
  bodyLength: bodyContent ? bodyContent.length : 0,
  url: window.location.href,
  title: document.title
})

// Verificar o conte√∫do do root e procurar por elementos
const root = document.getElementById('root');
const allElements = document.querySelectorAll('*');
const visibleElements = Array.from(allElements).filter(el => {
  const style = window.getComputedStyle(el);
  return style.display !== 'none' && style.visibility !== 'hidden' && el.offsetHeight > 0;
});

JSON.stringify({
  rootContent: root ? root.innerHTML : 'No root element',
  rootClasses: root ? root.className : 'No root element',
  visibleElementsCount: visibleElements.length,
  bodyClasses: document.body.className,
  bodyStyles: window.getComputedStyle(document.body).cssText.slice(0, 200)
})

// Verificar erros no console
const logs = [];
// Interceptar console
const methods = ['log', 'error', 'warn'];
methods.forEach(method => {
  const original = console[method];
  console[method] = function(...args) {
    logs.push({ method, args: args.map(arg => String(arg)) });
    original.apply(console, args);
  };
});

// Aguardar um momento
setTimeout(() => {
  // Fazer uma requisi√ß√£o de teste
  fetch('http://localhost:3333/api/claude-sessions')
    .then(res => res.text())
    .then(text => {
      console.log('API Response:', text);
    })
    .catch(err => {
      console.error('API Error:', err.message);
    });
}, 100);

// Retornar ap√≥s um delay
new Promise(resolve => {
  setTimeout(() => {
    resolve(JSON.stringify({
      logs,
      bodyContent: document.body.innerHTML.substring(0, 500),
      rootElement: document.getElementById('root')?.innerHTML?.substring(0, 500)
    }));
  }, 1000);
})

// Aguardar um momento e verificar o conte√∫do
setTimeout(() => {
  const root = document.getElementById('root');
  const allText = document.body.innerText;
  const hasNav = document.querySelector('nav');
  const links = Array.from(document.querySelectorAll('a')).map(a => ({ text: a.innerText, href: a.href }));

  console.log({
    rootHTML: root ? root.innerHTML : 'No root',
    bodyText: allText,
    hasNav: !!hasNav,
    links: links
  });
}, 1000);

"Aguardando..."

// Capturar erros e logs do console
const logs = [];
let errorCount = 0;

// Verificar se h√° erros
if (window.console && window.console.error) {
  const originalError = console.error;
  console.error = function(...args) {
    errorCount++;
    logs.push({ type: 'error', message: args.join(' ') });
    originalError.apply(console, args);
  };
}

// Verificar o estado da aplica√ß√£o
const root = document.getElementById('root');
const scripts = Array.from(document.querySelectorAll('script')).map(s => s.src || 'inline');

// Tentar for√ßar um reload do m√≥dulo principal
if (window.location) {
  console.log('URL atual:', window.location.href);
}

// Retornar informa√ß√µes de debug
JSON.stringify({
  rootExists: !!root,
  rootHTML: root ? root.innerHTML.substring(0, 200) : null,
  bodyClasses: document.body.className,
  scripts: scripts,
  errorCount: errorCount,
  logs: logs,
  reactDevTools: typeof window.__REACT_DEVTOOLS_GLOBAL_HOOK__ !== 'undefined'
})

